import Link from 'next/link'

const List = () => {
  const[listItem, setListItem]=  useState([]);
  const API = "http://www.songsterr.com/a/ra/songs/byartists.json?";

  useEffect(()=>{
    window
      .fetch(`${API}artists=Juanes`)
      .then((response) => response.json())
      .then(data=>{
        console.log(data)
        setListItem(data)
      });
  },[])

  return (
    <div>
      {listItem.map((song)=>{
        {/* console.log(song.title) */}
        return <Link href="">{song.title}</Link>; 
      })}
    </div>
  );
};

export default List;
